export enum Sex {
  MALE = 'male',
  FEMALE = 'female',
  OTHER = 'other'
}

export enum TennisLevel {
  BEGINNER = 'beginner',
  INTERMEDIATE = 'intermediate',
  ADVANCED = 'advanced',
  PROFESSIONAL = 'professional'
}

export interface User {
  id: number;
  email: string;
  first_name: string;
  last_name: string;
  date_of_birth: string;
  sex: Sex;
  tennis_level: TennisLevel;
  is_active: boolean;
  created_at: string;
  profile_image?: string | File;
}

export interface LoginCredentials {
  username: string;
  password: string;
}

export interface RegisterData {
  email: string;
  password: string;
  first_name: string;
  last_name: string;
  date_of_birth: string;
  sex: Sex;
  tennis_level: TennisLevel;
}

export interface AuthResponse {
  access_token: string;
  token_type: string;
}

export interface Event {
  id: number;
  court_location: string;
  event_date: string;
  event_time: string;
  max_participants: number | null;
  is_cancelled: boolean;
  created_at: string;
  organizer_id: number;
  registrations: EventRegistration[];
}

export interface EventRegistration {
  id: number;
  event_id: number;
  user_id: number;
  registration_date: string;
}
